import './App.css';
import HomePage from './components/homePage.component';
import Destinations from './components/destinations.component'
import {  BrowserRouter, Routes,Route,Navigate} from "react-router-dom";
import MyPage from './components/myPage.component'
import Login from './components/login.component'
import Register from './components/register.component'
 import MyFlights from './components/myFlights'
 import AuthService from './components/AuthService';
// import PrivateRoute from './components/PrivateRoute';
const PrivateRoute = ({ element: Element, ...rest }) => {
  const isAuthenticated = AuthService.isAuthenticated();
  return (
    <Route
      {...rest}
      element={
        isAuthenticated ? (
          <Element />
        ) : (
          <Navigate to="/login" replace={true} />
        )
      }
    />
  );
};

function App() {
  return (
    <BrowserRouter>
    <Routes>

       <Route exact path="/" element={<HomePage />} />
       <Route path="/api/v1/destination" element={<Destinations />} />
       <Route path="/login" element={<Login />} />
       <Route path="/register" element={<Register />} />
       <PrivateRoute path="/api/v1/destination/:id/" element={<MyPage />} />
       {/* <Route path="/api/v1/destination/:id/" element={<PrivateRoute component={MyPage} />} /> */}
       {/* <Route path="/api/v1/destination/:id" element={<MyPage />} /> */}
       {/* this needs to take an id the myFlights page */}
       <Route path="/myFlights" element={<MyFlights />} />
    </Routes>
  </BrowserRouter>
    // <Router>
    //    <HomePage />
    //    <Route path="/destinations" exact component={Destinations} />
    // </Router>

    // <div className="App">
    //   <header className="App-header">
    //     <img src={logo} className="App-logo" alt="logo" />
    //     <p>
    //       Edit <code>src/App.js</code> and save to reload.
    //     </p>
    //     <a
    //       className="App-link"
    //       href="https://reactjs.org"
    //       target="_blank"
    //       rel="noopener noreferrer"
    //     >
    //       Learn React
    //     </a>
    //   </header>
    // </div>
  );
}

export default App;
